tinymce.PluginManager.add("map-embed",function(n){n.addButton("map-embed",{text:"",icon:"map",onclick:function(){n.windowManager.open({title:"Add Google Map",body:[{type:"textbox",name:"address",label:"Address"},{type:"textbox",name:"width",label:"Map Width",value:"600"},{type:"textbox",name:"height",label:"Map Height",value:"400"}],onsubmit:function(e){var a=e.data.address.replace(/[ ,.]/gi,"+").replace("++","+"),t=e.data.width||600,d=e.data.height||400;n.insertContent('<iframe src="https://www.google.com/maps/embed/v1/place?q='+a+'&key=AIzaSyDFeIscDPUnxhQG0rUknxij-JNOmNEJifc" width="'+t+'" height="'+d+'" frameborder="0" style="border:0" allowfullscreen></iframe>')}})}})});